func GetShare(id string) []byte {
	if share, ok := shareData[id]; ok {
		return []byte(share)
	}
	return nil
}

func GetPreParams(id string) *keygen.LocalPreParams {
	share := new(keygen.LocalPartySaveData)
	if shareBytes := GetShare(id); shareBytes == nil {
		return nil
	} else if err := json.Unmarshal(shareBytes, share); err != nil {
		return nil
	}
	return &share.LocalPreParams
}

func GetOrGenPreParams(id string) *keygen.LocalPreParams {
	if preParams := GetPreParams(id); preParams != nil {
		return preParams
	}
	fmt.Printf("generating pre params for %s\n", id)
	preParams, err := keygen.GeneratePreParams(5 * time.Minute)
	fmt.Printf("pre params for %s generated\n", id)
	marshalled, err := json.Marshal(preParams)
	if err != nil {
		panic(err)
	}
	fmt.Println(string(marshalled))
	return preParams
}

